import React from "react";
import ReactDOM, { render } from "react-dom";
import { useState } from "react";
import "./index.scss";
import addButton from "./add.svg";
import Header from "./header.js";
import firebase from "firebase";

function Content({ setCurrentScreen }) {
  const firebaseApp = firebase.apps[0];

  return (
    <div className="content">
      {JSON.stringify(firebaseApp.options, null, 2)}
      <Menu />
      <List setCurrentScreen={setCurrentScreen} />
    </div>
  );
}

function Menu() {
  return (
    <div className="menu-container">
      <h1 className="menu-head"> Explore </h1>
      <h1 className="menu-head"> My work </h1>
      <h3 className="menu-subhead"> Notebooks</h3>
      <h3 className="menu-subhead"> Datasets</h3>
      <h3 className="menu-subhead"> Charts</h3>
    </div>
  );
}

function List({ setCurrentScreen }) {
  return (
    <div className="list-container">
      <div className="list-header">
        <h1>Notebooks</h1>
        <img
          className="add-button"
          src={addButton}
          alt="Add Button"
          onClick={() => setCurrentScreen(PAGES.notebook)}
        ></img>
      </div>
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
      <ItemContainer />
    </div>
  );
}

class ItemContainer extends React.Component {
  render() {
    return (
      <div className="list-item">
        <div className="item-contents-row-one">
          <h3>Adam's Notebook</h3>
          <button className="edit-button wrap">Edit</button>
        </div>
        <div className="item-contents-row-two">
          <p>Last edited</p>
          <p>Yesterday</p>
        </div>
      </div>
    );
  }
}

const PAGES = { homepage: "homepage", notebook: "notebook" };

function Container() {
  const [currentScreen, setCurrentScreen] = useState(PAGES.homepage);
  console.log(currentScreen);

  switch (currentScreen) {
    case PAGES.homepage:
      return (
        <div>
          <Header />
          <Content setCurrentScreen={setCurrentScreen} />
        </div>
      );
    case PAGES.notebook:
      return "notebook";
  }
}

const firebaseConfig = {
  apiKey: "AIzaSyDBTVpLIWCa_eD4Y1fNmagEbJ3yJ59oE_g",
  authDomain: "hcil-website.firebaseapp.com",
  databaseURL: "https://hcil-website.firebaseio.com",
  projectId: "hcil-website",
  storageBucket: "hcil-website.appspot.com",
  messagingSenderId: "1089716918653",
  appId: "1:1089716918653:web:8d47f9a294973c7cd01414",
  measurementId: "G-E92GSV896D"
};
// Initialize Firebase
firebase.initializeApp(firebaseConfig);
firebase.analytics();

ReactDOM.render(<Container />, document.getElementById("root"));
